function App() {
  return (
    <div class="middle">
      <div class="center">
        <div class="container">
          <h1>Welcome to Fam Reveal</h1>
          <form class="container" >

            <label>
              Choose your family:
            </label>
            <input type="text" id="name" required />
            <button type="submit">Reveal!</button>
          </form>
        </div>
      </div>
    </div>
  );
}

